final databaseRef = FirebaseDatabase.instance.ref('Clients');

int? _epochFromDdMmmYyyy(String s) {
  s = s.trim();
  if (s.isEmpty) return null;
  final m = RegExp(r'^(\d{1,2})-([A-Za-z]{3})-(\d{4})$').firstMatch(s);
  if (m == null) return null;
  final day  = int.parse(m.group(1)!);
  final mon3 = m.group(2)!.substring(0, 3).toLowerCase();
  const months = {
    'jan': 1, 'feb': 2, 'mar': 3, 'apr': 4, 'may': 5, 'jun': 6,
    'jul': 7, 'aug': 8, 'sep': 9, 'oct': 10, 'nov': 11, 'dec': 12,
  };
  final month = months[mon3];
  final year  = int.parse(m.group(3)!);
  if (month == null) return null;
  // Local midnight; use DateTime.utc(...) if you prefer UTC
  return DateTime(year, month, day).millisecondsSinceEpoch;
}

